\u0412\u043e\u043f\u0440\u043e\u0441 12.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Название сказки "12 месяцев" упоминалось после слов "Срок годности";
упаковку сгущенки автор изучал не просто так, а чтобы выяснить, стоит ли
пытаться ее употребить в пищу.

\u0412\u043e\u043f\u0440\u043e\u0441 2.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Каждый интерпретирует (по сути, переводит) слова Господа по-своему;
упомянутые поэты прославились не только своими оригинальными
произведениями, но и переводами.

\u0412\u043e\u043f\u0440\u043e\u0441 5.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Это короткометражка, вошедшая в 46-й выпуск киножурнала "Ералаш"; герой
Хазанова - школьный учитель, которому достается самый трудный класс;
фильм снят на итальянском языке с одноголосым закадровым переводом.
